import React from 'react';
import ServiceButton from "./service/ServiceButton";

function DropDownService(props) {
    return (
        <div>
            <ServiceButton/>
            <div className="dropdown">
                <ul>
                    <li>Option 1</li>
                    <li>Option 2</li>
                    <li>Option 3</li>
                    <li>Option 4</li>
                </ul>
            </div>
        </div>
    );
}

export default DropDownService;
